import React from 'react';
import '../css/main.css';

function UserRowSub() {
    return (
        <div className="user__body-row user__body-row--more" data-id={this.props.id} data-index={this.props.index}>
            <div className="user__body-cell user__body-cell--action"></div>
            <div className="user__body-cell user__body-cell--title">{this.props.title}</div>
            <div className="user__body-cell user__body-cell--longFull">{this.props.long}</div>
            <div className="user__body-cell user__body-cell--link">{this.props.link}</div>
        </div>
    );
}

export default UserRowSub;
